import React from "react";
import ReactDOM from "react-dom";
import sData from "./components/demo1";

function nard(val){
    return (
        <h1>{val.name}</h1>
    );
}

ReactDOM.render(
    <>
        {sData.map(nard)}
    </>,
    document.getElementById('root')
);
